import {  GlobalState } from "@/../App";
import DailyList from "@/components/DailyList";
import { DefaultTheme } from "@/style/styled";
import { DailyListProps } from "@/utils/data";
import dayjs from "dayjs";
import React from "react";
import { SafeAreaView, View, StyleSheet } from "react-native";
import { useSelector } from "react-redux";

function Main(){
    const theme = useSelector(({theme}:GlobalState) => theme);
    return(
        <SafeAreaView style={styles(theme).container}>
            <DailyList {...dailylist_dummy}/>
            <Da style={{flex: 5}}/>
        </SafeAreaView>
    )
}

const styles = (theme:DefaultTheme) => StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: theme.mainBackground,
      alignItems: 'center',
      justifyContent: 'center',
    },
});

export default Main;

const dailylist_dummy:DailyListProps = {
    start: dayjs().subtract(3, 'days'),
    end: dayjs().add(3, 'days'),
    events:[
        {
            dateof: 1,
            title: "런닝머신 30분",
            abb: "런닝머신",
            content: "9km/h 5분 12km/h 5분 반복",
            icon: "running",
            date: dayjs(),
            completed: false,
            color: "#ffc8c8"
        },
        {
            dateof: 1,
            title: "영단어 100개 암기",
            content: "TOEIC 영단어 1~100",
            abb: "영단어",
            icon: "study",
            date: dayjs(),
            completed: false,
            color: "#bbbbff"
        },
        {
            dateof: 2,
            title: "영단어 100개 암기",
            content: "TOEIC 영단어 101~200",
            abb: "영단어",
            icon: "study",
            date: dayjs().add(1, 'days'),
            completed: false,
            color: "#bbbbff"
        },
        {
            dateof: 3,
            title: "영단어 100개 암기",
            content: "TOEIC 영단어 201~300",
            abb: "영단어",
            icon: "study",
            date: dayjs().add(2, 'days'),
            completed: false,
            color: "#bbbbff"
        },
    ]
  }
